# Chubukaran, Slakbashevsky Selsoviet, Belebeyevsky District, Republic of Bashkortostan

}}
Chubukaran (; , Sıbıqaran) is a rural locality (a village) in Slakbashevsky Selsoviet, Belebeyevsky District, Bashkortostan, Russia. The population was 25 as of 2010.
Geography
It is located 35&nbsp;km from Belebey and 10&nbsp;km from Slakbash.
